const Symbol = (props) => {
  return (
    <>
      <p className="coin-symbol">Symbol: {props.symbol}</p>
    </>
  );
};

const Humidity = (props) => {
  return (
    <p className="humidity">
      Humidity: <span className="value">{props.humidity}%</span>
    </p>
  );
};

export default Symbol;
